s($,"aR6","arU",()=>{var q="Tencent",p="Nice Boat Animation",o=2020,n="Bilibili"
return A.c([A.e7("Battle Through the Heavens",q,2017,"assets/images/BTTH.webp","Xiao Yan, seorang jenius seni bela diri, kehilangan kekuatannya karena pengkhianatan. Dengan bantuan misterius Yao Lao, ia memulai perjalanan panjang penuh pertempuran, persahabatan, dan pengkhianatan untuk menguasai api surgawi dan membalas dendam.","Xiao Yan"),A.e7("Soul Land",q,2018,"assets/images/SoulLand.webp","Tang San, murid berbakat dari sekte Tang, melanggar aturan sekte dan bereinkarnasi ke dunia penuh roh bela diri. Dengan kecerdasannya, ia berusaha menjadi master roh terkuat meski menghadapi tantangan besar.","Tang San"),A.e7("Martial Universe","Alibaba Pictures",2018,"assets/images/martial_universe.webp","Lin Dong, pemuda biasa, menemukan jimat batu kuno dengan kekuatan misterius. Dari sanalah perjalanannya dimulai untuk melawan klan besar, menemukan cinta, dan berusaha menjadi legenda di dunia seni bela diri.","Lin Dong"),A.e7("The King\u2019s Avatar","G.CMay Animation",2017,"assets/images/kings.webp","Ye Xiu, pemain profesional game Glory, dipaksa pensiun dari timnya. Namun, ia kembali ke dunia e-sports dengan identitas baru dan membuktikan dirinya sebagai legenda sejati.","Ye Xiu"),A.e7("Fog Hill of Five Elements",p,o,"assets/images/fog_hills.jpg","Di dunia di mana monster dan manusia hidup berdampingan, lima pejuang dengan kekuatan elemen berusaha melindungi umat manusia dari ancaman mematikan yang mengintai di balik kabut tebal.","Warrior of Fire"),A.e7("White Cat Legend",p,o,"assets/images/white_cat.jpg","Seorang pejabat rendah bertemu dengan kucing putih besar misterius yang ternyata adalah seorang jenderal legendaris. Bersama-sama mereka menghadapi intrik politik dan misteri dunia roh.","General Cat"),A.e7("The Outcast","Haoliners Animation",2016,"assets/images/the_outcast.jpg","Zhang Chulan terjebak dalam dunia orang-orang dengan kekuatan khusus. Dengan warisan misterius dari kakeknya, ia berusaha mengungkap rahasia besar sambil bertahan hidup dari organisasi rahasia.","Zhang Chulan"),A.e7("A Record of a Mortal\u2019s Journey to Immortality",n,o,"assets/images/record_immortal.webp","Han Li, seorang pemuda biasa dari keluarga miskin, secara kebetulan masuk ke dunia kultivasi. Dengan kecerdikan, tekad, dan keberuntungan, ia berjuang dari titik terendah untuk mencapai keabadian.","Han Li"),A.e7("Perfect World",q,2021,"assets/images/perfect_world.jpg","Shi Hao, seorang anak ajaib dari desa kecil, menapaki jalan kultivasi penuh darah dan air mata. Dengan tubuh yang diberkati, ia berusaha menjadi penguasa dunia dan melindungi orang-orang yang ia cintai.","Shi Hao"),A.e7("Swallowed Star",q,o,"assets/images/swallowed.webp","Di dunia pasca-apokaliptik, Luo Feng menemukan jalan untuk menjadi pejuang super. Dari bumi hingga luar angkasa, ia menantang nasib dan berjuang demi kemanusiaan.","Luo Feng"),A.e7("Start to Be a Star Today",n,2019,"assets/images/star.webp","Seorang pemuda biasa mendapatkan sistem yang membawanya ke dunia hiburan. Dengan usaha dan tekad, ia perlahan menjadi bintang besar yang bersinar di panggung dunia.","Lin Fan"),A.e7("Shrouding the Heavens",q,2023,"assets/images/shrouding_heavens.jpg","Ye Fan dan teman-temannya terseret ke dunia misterius setelah menemukan peti kuno. Dari sana, ia menapaki jalan kultivasi yang penuh misteri, tragedi, dan kebangkitan.","Ye Fan"),A.e7("Renegade Immortal",n,2024,"assets/images/renegade_immortal.webp","Wang Lin, seorang pemuda biasa, secara tak terduga mendapatkan peluang besar dalam kultivasi. Dengan kecerdikan, ketekunan, dan pengorbanan, ia menjadi legenda abadi yang ditakuti para dewa.","Wang Lin"),A.KJ("Spicy Girl",n,2019,"assets/images/spicy_girl.jpg","Seorang gadis tangguh yang ahli bela diri terjebak dalam dunia hiburan modern. Dengan sikap blak-blakan, ia menghadapi cinta, persaingan, dan perjalanan menuju popularitas.","Su Xiao"),A.KJ("Be My Wife",q,o,"assets/images/bemywife.jpg","Seorang wanita modern terjebak dalam pernikahan kontrak dengan pria dingin nan misterius. Perlahan, hubungan mereka berubah menjadi cinta sejati yang penuh emosi.","Xia Yu & Han Chen"),A.KJ("Love Between Fairy and Devil","iQIYI",2022,"assets/images/fairy_devil.jpg","Donghua romantis penuh fantasi tentang hubungan terlarang antara peri lembut dengan iblis kuat. Dari kebencian hingga cinta, mereka menantang takdir dan dunia.","Xiao Lan Hua & Dong Fang Qing Cang"),A.KJ("The Beauty Blogger",n,2018,"assets/images/beauty_blogger.jpg","Seorang beauty blogger modern terjebak dalam game VR fantasi. Untuk bertahan hidup, ia harus menggunakan kecerdikannya sembari menemukan cinta dan persahabatan di dunia baru.","Chen Xiao"),A.e7("Tales of Herding Gods",q,o,"assets/images/tales_hearding.webp","Qin Mu, seorang pemuda misterius, tumbuh bersama para dewa yang terbuang. Dengan warisan unik, ia menantang kekuatan besar untuk mengungkap rahasia dunia dan dirinya.","Qin Mu"),A.e7("Sword of Coming",n,2024,"assets/images/sword.jpg","Chen Ping'an, pemuda sederhana dengan pedang tua, memulai perjalanan kultivasi panjang. Dengan ketekunan, ia berusaha menjadi pendekar pedang sejati yang disegani dunia.","Chen Ping'an"),A.e7("Slay the God",q,2023,"assets/images/slay_god.jpg","Seorang pemuda pemberani menghadapi dewa-dewa korup dalam pertempuran epik. Dengan tekad dan kekuatan misterius, ia berusaha menumbangkan tirani ilahi.","Unknown Hero"),A.e7("Eclipse of Illusion",n,2022,"assets/images/eclipse_illusion.jpg","Sekelompok anak muda terjebak di antara dunia nyata dan dunia fantasi ilusi. Mereka harus menemukan kebenaran dan kekuatan sejati untuk menyelamatkan dunia.","Ling Yu"),A.e7("Lord of the Mysteries",n,2025,"assets/images/lord_mysteries.jpeg","Klein Moretti, seorang detektif muda, terjerat dalam dunia penuh kabala, ramalan, dan misteri supranatural. Dengan kecerdikan, ia mencoba mengendalikan takdir di dunia gelap nan berbahaya.","Klein Moretti"),A.KJ("Fox Spirit Matchmaker","Haoliners",2015,"assets/images/fox.webp","Menurut legenda kuno, roh rubah dan manusia dapat menjalin cinta yang melampaui reinkarnasi. Kisah ini mengikuti Tushan Susu dan Bai Yuechu dalam perjalanan penuh humor, air mata, dan romansa yang menantang batas antara dunia roh dan manusia.","Love & Reincarnation")],A.ai("A<qG>"))})
